import "./index.css";
import { useNavigate } from "react-router-dom";

export function NewStore() {
  const MapsPage = useNavigate();
  const Mapspa = (e) => {
    navigate("/");
  };
  return (
    <div className="tools">
      <h1>Cadastrar loja</h1>
      <div className="name-store">
        <input placeholder="Nome da loja" type="text" />
      </div>
      <div classeName="name-city">
        <input placeholder="Cidade" type="text" />
      </div>
      <div className="latitude">
        <input placeholder="Latitude" type="text" />
      </div>
      <div className="longitude">
        <input placeholder="Longitude" type="text" />
      </div>
      <div className="amount">
        <input placeholder="Montante" type="text" />
      </div>

      <button onClick={MapsPage}>Cadastrar</button>
    </div>
  );
}
